  /// Get levels by theme name.
  static List<Level> getLevelsByTheme(String theme) {
    switch (theme) {
      case 'Ocean':
        return oceanLevels;
      case 'Forest':
        return forestLevels;
      case 'Desert':
        return desertLevels;
      case 'Space':
        return spaceLevels;
      default:
        throw ArgumentError('Unknown theme: $theme');
    }
  }

  /// Get all levels across all themes.
  static List<Level> getAllLevels() {
    return [
      ...oceanLevels,
      ...forestLevels,
      ...desertLevels,
      ...spaceLevels,
    ];
  }
